.loginClick /deep/ .is-top .el-tabs__active-bar {
  background-color: #fff;
}
.loginClick /deep/ .is-top .el-tabs__nav-wrap::after {
  background-color: #fff;
}
.loginClick /deep/ .is-top {
  margin: 0 7px;
}
.verification {
  width: 60%;
  float: left;
}
.codeClick {
  width: 40%;
  float: left;
  text-align: center;
  cursor: pointer;
}
.hint {
  color: #999;
  font-size: 14px;
  font-weight: 500;
  margin-bottom: 22px;
}
.hint:before,
.hint:after {
  content: "";
  width: 83px;
  border-top: 1px #999 solid;
  display: inline-block;
  vertical-align: middle;
}
.hint:before {
  margin-right: 10px;
}
/* .hint:after{
  margin-left: 10px;
} */
.forgetDiv {
  text-align: right;
}
.forgetPassword {
  border: 0;
  background: none;
  padding: 0;
}
.pwdLogin {
  margin-bottom: -5px;
}

.login-wrap {
  box-sizing: border-box;
  width: 100%;
  height: 100%;
  padding-top: 10%;
  background-image: url(data:image/svg+xml;base64,);
  /* background-color: #112346; */
  background-repeat: no-repeat;
  background-position: center right;
  background-size: 100%;
}
.login-container {
  border-radius: 10px;
  margin: 0px auto;
  width: 350px;
  padding: 30px 35px 15px 35px;
  background: #fff;
  border: 1px solid #eaeaea;
  text-align: left;
  box-shadow: 0 0 20px 2px rgba(0, 0, 0, 0.1);
}
.title {
  margin: 0px auto 40px auto;
  text-align: center;
  color: #505458;
}
.remember {
  margin: 0px 0px 35px 0px;
}
.code-box {
  text-align: right;
}
.codeimg {
  height: 40px;
}
